import { useDispatch } from 'react-redux';
import './Button.scss';

export const CtButton = ({ data }) => {
    const dispatch = useDispatch();
    return (
        <div className="ct__button prefixIcon" onClick={dispatch(setTasks("Learn the basics with the easy-to-follow Getting Started Guide ðŸ”—"))}>
            <div className='left'>
                {data.prefixIcon}
                {data.description}
            </div>
            <div className="right">
                {data.suffixIcon}
            </div>
        </div>
    );
}
